function memoizedDebounce(func, wait) {
  const cache = new Map();
  let timeoutId;

  return function (...args) {
    const key = JSON.stringify(args);
    clearTimeout(timeoutId);

    if (cache.has(key)) {
      return cache.get(key);
    }

    timeoutId = setTimeout(() => {
      const result = func.apply(this, args);
      cache.set(key, result);
    }, wait);
  };
}

