function processUserData(data) {
  if (data.name) {
    if (data.age) {
      if (data.email) {
        return {
          name: data.name.trim(),
          age: parseInt(data.age),
          email: data.email.toLowerCase(),
        };
      } else {
        return null;
      }
    } else {
      return null;
    }
  } else {
    return null;
  }
}
